import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  width: 100%;
  height: 94px;
  background: #f4f4f4;
  p {
    margin: 0;
  }
  > p:first-child {
    margin-bottom: 10px;
  }
`;
